import React from 'react';
import { Box, Grid, Paper, Stack, Typography } from '@mui/material';
import "./styles.css";

const canvases = [ 'Stickies', 'Notepad', 'Blank canvs'];

const HomePage = ()  => {
  return (
    <Stack
      spacing={2}
      sx={{ p: 2 }}
    >
      <Typography variant="h2">
          Welcome to Jot
        </Typography>
        <Typography variant="subtitle1">
          Pick your canvas
        </Typography>
        <Grid container>
          <Grid item container spacing={3} sx={{ border: 1}}>
            {canvases.map(( item ) => (
              <Grid item xs={3}>
                <Box component={Paper}>
                  {item}
                </Box>
              </Grid>
            ))}
          </Grid>
        </Grid>
    </Stack>
  );
};

export default HomePage;
